import React from 'react';
import Header from './components/header/Header';
import Footer from './components/footer/Footer';
import Register from './components/register/Register';
import HomeScreen from './components/screens/HomeScreen';
import { Navigate, BrowserRouter, Routes, Route } from "react-router-dom";
import { DatePicker,Row,Col } from 'antd';
import 'antd/dist/antd.css';
import './App.css';

function App() {
  return (
    <div className="App">
       <BrowserRouter>
        <Routes>
          <Route path={PATHS.HOME} element={<HomeScreen />} /> 

          { /* // quand on veut creer un route on envoyer des donn√©es nom user par exp...
                <Route path={PATHS.ABOUT} element={<Test1 title="{props.title}" />} /> */}

          <Route path={PATHS.ABOUT} element={<Test1  />} /> 

          <Route path={PATHS.RESUME} element={<Comp />} /> 
          <Route path={PATHS.WORKS} element={<Form />} /> 
          <Route path={PATHS.CONTACT} element={<Form />} />  

          <Route path="/" element={<Navigate replace to="/home" />} /> 





        </Routes>
      </BrowserRouter>
      <Header />

      <Row className='register-form'>

       {/**<Register /> */} 
        <HomeScreen />

      </Row>


      <Footer /> 
    </div>
  );
}

export default App;
